import React from "react";
import ExpenseDate from "./ExpenseDate";
import "./Expenses.css";

export default function Expenses(props) {
  return (
    <div>
      <ExpenseDate date={props.expenses[0].date} />
      <div>
        <h2>{props.expenses[0].title}</h2>
        <div>{props.expenses[0].amount}</div>
      </div>
    </div>
  );
}
